import React, { useState } from 'react';
import styled from 'styled-components';
import { colors } from '../../styles';
import VideoIntro from './VideoIntro';

const Box = styled.div`
  height: 80px;
  overflow-y: hidden;
  border-bottom: 1px solid ${colors().darkGrey};
`;
const Heading = styled.div`
  padding: 30px 5px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  color: ${colors().navy1};
  h3 {
    font-size: 22px;
  }
`;
const Main = styled.div`
  padding: 40px 0;
`;

function VideoItem() {
  const [isOpened, setOpened] = useState(false);

  return (
    <Box>
      <Heading onClick={() => setOpened((prev) => !prev)}>
        <h3>Tytu≈Ç tej sekcji</h3>
        <i class="fa fa-chevron-down"></i>
      </Heading>
      <Main>
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Quia sequi
          veniam tempora animi hic velit iusto obcaecati exercitationem
          accusamus quisquam.
        </p>
        <iframe
          width="350"
          height="220"
          src="https://www.youtube.com/embed/PUGW7ehLrww"
          title="YouTube video player"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </Main>
    </Box>
  );
}

export default VideoItem;
